    true,nt"url": null,nt"notes": "The Level-3 Aura/OMI daily global TOMS-Like
    Total Column Ozone gridded product (OMTO3d) is generated by the NASA OMI science
    team by gridding and averaging only good quality level-2 total column ozone orbital
    swath data (OMTO3, based on the enhanced TOMS version-8 algorithm) on the 1x1 degree
    global grids. OMTO3d product is made available from the GES DISC ( http://mirador.gsfc.nasa.gov/)
    for the public access. The documents giving the details of data filtering and the
    data read and visualization software are also made available from the GES DISC site:
    http://disc.gsfc.nasa.gov/Aura/OMI/omto3d_v003.shtml . n (The shortname for this
    Level-3 TOMS-Like total column ozone product is OMTO3d_V003) n  There are two Aura/OMI
    daily global TOMS-Like Total Column Ozone gridded products, OMTO3e is gridded in
    0.25x0.25 degree, and OMTO3d is gridded in 1x1 degree.",nt"license_title":
